import React from 'react'
import {
  List,
  Datagrid,
  TextField,
  DateField,
  EditButton,
  DeleteButton,
} from 'react-admin'
import Link from '@mui/material/Link';
import { UrlField } from 'react-admin';

const checkTime = (e) => {
  console.log(e)
}

const SongList = (props) => {
  return (
    <List {...props}>
      <Datagrid>
        <TextField source='id' />
        <TextField source='song_name' />
        <TextField source='song_duration' />
        <DateField source='date_added' />  
        <TextField source='stream_count' />
        <TextField source='path' />  
        <UrlField source="song_image" />
        <TextField onClick={(e) => checkTime(e)} source='song_image' />
        <EditButton basePath='/songs' />
        <DeleteButton basePath='/songs' />
      </Datagrid>
    </List>
  )
}

export default SongList
